import s from "./styles/dist/App.module.css";
import React, {useState} from "react";
import Form from "./components/Form";
import TodoItemList from "./components/TodoItemList";

function App() {
      return (
            <div className={s.wrapper}>
                  <Form />
                  <TodoItemList />
            </div>
      );
}

export default App;
